import React from 'react';
import logo from './logo.svg';
import SortingVisualizer from './SortingVisualizer/SortingVisualizer';
import './App.css';

function App() {
  return (
    <div className="AppHeader">
      <h2>Algorithm Visualizer</h2>
    <div className="App">
      <SortingVisualizer></SortingVisualizer>
    </div>
    </div>
  );
}

export default App;
